import axios from 'axios';
export const searchPhotos = async (term) => {
    const photos = await axios.get("https://api.unsplash.com/search/photos",{
      headers: {
        Authorization: "Client-ID BNKk84u3TNG9-iyzVFd9LUuw4eNoR6FykPYoj2kxGvU",
      },
      params: {
        query: term,
      }
    });
    return photos.data;
};

export const getAllPhotos = async () => {
    const photos = await axios.get("https://api.unsplash.com/photos",{
      headers: {
        Authorization: "Client-ID BNKk84u3TNG9-iyzVFd9LUuw4eNoR6FykPYoj2kxGvU",
      },  
    });
     return photos.data;
};
export const getPhoto = async (id) => {
    const photo = await axios.get(`https://api.unsplash.com/photos/${id}`,{
      headers: {
        Authorization: "Client-ID BNKk84u3TNG9-iyzVFd9LUuw4eNoR6FykPYoj2kxGvU",
      },  
    });
    console.log(photo);
};
